export const styles = theme => ({
    root: {
        display: "flex",
        padding: 0,
    },
    item: {
        alignItems: "center",
        background: theme.palette.text.disabled,
        borderRadius: "100%",
        display: "flex",
        height: "40px",
        justifyContent: "center",
        listStyle: "none",
        width: "40px",
        "& + &": { marginLeft: theme.spacing(1) },
    },
});
